import s from './Profile.module.css';
import MyPosts from './MyPosts/MyPosts'

const Profile = () => {
    return (
        <div className={s.content}>
            <div>
                <img src="https://phuquoclife.ru/wp-content/uploads/2019/11/gde-vstretit-rassvet-na-fukuok-3-870x400.jpg" />
            </div>
            <div>
                ava + description
            </div>
            <MyPosts />
        </div>
    )
}

export default Profile
